import React, {useState} from 'react';
import TodoList from './TodoList';
import "../style/rush.css";

function Rush() {
  const [todos, setTodos] = useState([{}])
  return (
    <div className="rush">

      <TodoList todos={todos}/>
      <input type="text"/>
      <button>Add Todo</button>
      <button>Clear Completed Todos</button>
      <div> 0 left todo </div>

    </div>
  );
}


export default Rush;
